import WebFormSelect from "./WebFormSelect";
import { useReducer } from "react";

const WebForm = ({fields}) => {
    const [webFormFields, setWebFormFields] = useReducer((state, action) => {
        switch(action.type) {

            default:
                return state;
        }
    }, fields)


return (
    <>
        <WebFormSelect  webFormFields={webFormFields}/>
    </>
)
}

export default WebForm;
